import { FETCH_ALL, CREATE, UPDATE} from '../constants/actionTypes';

const reducer =  (posts = [], action) => {
  switch (action.type) {
    case FETCH_ALL:
      return posts;
    case CREATE:
      return posts;
    default:
      return posts;
  }
};
